# 给定一个字符串 s，你可以通过在字符串前面添加字符将其转换为回文串。找到并返回可以用这种方式转换的最短回文串。
#
#
#
# 示例 1：
#
# 输入：s = "aacecaaa"
# 输出："aaacecaaa"
# 示例 2：
#
# 输入：s = "abcd"
# 输出："dcbabcd"
#
#
# 提示：
#
# 0 <= s.length <= 5 * 104
# s 仅由小写英文字母组成

from collections import defaultdict
class Solution:
    def shortestPalindrome1(self, s: str) -> str:
        def isPalindrome(s):
            N = len(s)
            for i in range(N // 2):
                a, b, c, d = s[i], s[N // 2 - i], N // 2 - 1 - i, N - i - N // 2
                if s[i] != s[N - 1 - i] or s[N // 2 - i - 1] != s[N - i - N // 2]:
                    return False
            return True
        def trans2Dict(s):
            sDict = defaultdict(int)
            for i in s:
                sDict[i] += 1
            return sDict
        N = len(s)
        sDict = trans2Dict(s)
        print(sDict)
        pos = 0
        for i in range(N, 0, -1):
            # print(i)
            if isPalindrome(s[:i]):
                pos = i
                break
        suffix = s[pos:]
        return suffix[::-1] + s

    def shortestPalindrome(self, s: str) -> str:
        s1 = s + '#' + s[::-1]
        def getPrefixTable(s):
            prefix = [0]
            curIdx, curLen = 1, 0
            while curIdx < len(s):
                if s[curIdx] == s[curLen]:
                    curLen += 1
                else:
                    while curLen > 0 and s[curIdx] != s[curLen]:
                        curLen = prefix[curLen-1]
                    if s[curIdx] == s[curLen]:
                        curLen += 1
                prefix.append(curLen)
                curIdx += 1
            return prefix
        prefix = getPrefixTable(s1)
        commonPrefixLen = prefix[-1]
        print("commonPrefixLen = ", commonPrefixLen)
        suffixLen = len(s) - commonPrefixLen

        return s[-1: -suffixLen-1: -1] + s




so = Solution()
print(so.shortestPalindrome("aaabcaaaab"))  # "ababbabbbabbaba"
print(so.shortestPalindrome("babbbabbaba"))  # "ababbabbbabbaba"
print(so.shortestPalindrome("aacecaaa"))
print(so.shortestPalindrome(""))
print(so.shortestPalindrome("abcd"))
print(so.shortestPalindrome(""))

